import React from 'react';

import styles from './Main.scss';

export default function Main({ viewDataWeatherCity, dataWeatherCity }) {
   console.log(dataWeatherCity.weather);
    return (
        <main className="Main">
            { viewDataWeatherCity ? 
                <div className='Main__wrapper'>
                    <img src='http://openweathermap.org/img/wn/02d@2x.png' alt="http://openweathermap.org/img/wn/02d@2x.png"/>
                    <div className="Main__data">
                        <div className="Main__data-temper">{parseInt(dataWeatherCity.main.temp)}&deg;</div>
                        <>
                            {
                                dataWeatherCity.weather.length > 1 ?
                                    <div className="Main__description">{dataWeatherCity.weather[0].description}, {dataWeatherCity.weather[1].description}</div>   
                                : <div className="Main__description">dataWeatherCity.weather.description</div>
                            }
                        </>
                    </div>        
                </div>
                :
                <div>выбери город</div>
            }
        </main>
    );
}
